It's also worth noting that this contract currently doesn't do anything with the Ether that is sent to it when it's deployed (the payable constructor). If you want the contract to do something with that Ether (like store it in a state variable), you would need to add that functionality.

Also, I noticed you mentioned that `0xffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff` means `-1`, but in Solidity this isn't the case. In Solidity, `0xffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff` is a very large positive integer, not `-1`.
